import { getData } from "../lib/data";
export default function({ allData }) {
  return (
    <div>
      {allData.map((Title, Author) => (
        <div>
          {Title}
          {Author}
        </div>
      ))}
      ))}
    </div>
  );
}
export async function getStaticProps() {
  const allData = getData();
  return {
    props: {
      allData
    }
  };
}
